import image7 from "../assets/img7.jpg";
import image8 from "../assets/img8.jpg";
import image9 from "../assets/img9.jpg";

const itemPrice = "$15";
const dataBot = {
  productsBot: [
    {
      id: "7",
      name: 7,
      price: itemPrice,
      image: image7,
    },
    {
      id: "8",
      name: 8,
      price: itemPrice,
      image: image8,
    },
    {
      id: "9",
      name: 9,
      price: itemPrice,
      image: image9,
    },
  ],
};
export default dataBot;
